import React from 'react';
import axios from 'axios';


const Deconnexion = () => {
    const deco = async (req, res) => {
        alert("eVoulez vous vraiment deconnecte")
        return;
        try {
            const mamono = await axios.get('http://localhost:8000/logout').then((response) => {
                console.log(response.data);
            })
        } catch (error) {
            console.log(error);
        }

    }
    return (
        <div>

        </div>
    );
};

export default Deconnexion;
